import React from 'react';

class Customer extends React.Component {
    render() {
        if (!this.props.data) {
            return "";
        }
        return (
            <div>
                <button class="cancelButton" onClick={this.props.onClick} >X</button>
                <div>
                    <p>Location: {this.props.data.city}, {this.props.data.province} </p>
                </div>

                <div>
                    <p>Product Catalog</p>
                </div>
                <div>
                    <p>Send Catalog</p>
                </div>
            </div>
        );
    }
}

export default Customer;
